import React, {Component} from 'react'
import Gapped from '@skbkontur/react-ui/Gapped'
import Typography from '@material-ui/core/Typography'
import Button from '@skbkontur/react-ui/Button'

import newCritics from '../../../../../TestData/Curator/newCritics'

interface Idata{
    name : string,
    position : string,
    course : number,
    department : string
}

interface Props{
}

interface State{

}

class NewCriticList extends Component<Props, State>{

    private renderItem(item : Idata){
        return(
            <Gapped>
                <Typography variant='h5'>{item.name}, cathedra {item.department}</Typography>
                <Button use='success'>Naznachit</Button>
            </Gapped>

        )
    }

    render(){
        return(
            <div className='newCriticList'>
                {newCritics.map(item => this.renderItem(item))}

            </div>
        )
    }
}

export default NewCriticList
